import styles from "./Investment.module.css";
import image1 from "../investment_logo.png";
import data from "../investors";

const InvestmentCard = ({ image, title, desc, link }) => {
  return (
    <>
      <div className={styles.investment}>
        <img src={image} />
        <div className={styles.investmentDesc}>
          <h3>{title}C</h3>
          <p>{desc}</p>
          <a href="#">{link}</a>
        </div>
      </div>
    </>
  );
};

const Investment = () => {
  return (
    <>
      {data.map((el) => (
        <InvestmentCard />
      ))}
    </>
  );
};

export default Investment;
